INSERT INTO `posts` (`id`, `title`, `slug`, `thumbnail`, `body`, `active`, `published_at`, `user_id`, `created_at`, `updated_at`, `meta_title`, `meta_description`) VALUES
(1, 'La conception de sites web responsives : qu\'est-ce que c\'est ?', 'la-conception-de-sites-web-responsives-quest-ce-que-cest', 'tFDifKDlYKYdANXQbGC3GZJ5WDa6W1-metaaW1hZ2UuanBn-.jpg', '<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: justify;\">La conception de sites web responsives, &eacute;galement connue sous le nom de conception adaptative, est une approche de conception de sites web qui permet aux pages web de s\'adapter automatiquement &agrave; diff&eacute;rents appareils et tailles d\'&eacute;cran. Cela signifie qu\'un site web qui utilise une conception responsive aura l\'air aussi bien sur un ordinateur de bureau que sur un smartphone ou une tablette.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt; color: #e67e23;\"><strong>Pourquoi la conception de sites web responsives est-elle importante ?</strong></span></p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: justify;\">Aujourd\'hui, la plupart des gens acc&egrave;dent &agrave; internet via leur smartphone ou leur tablette. Il est donc essentiel que les sites web soient con&ccedil;us de mani&egrave;re &agrave; s\'adapter &agrave; ces appareils. En effet, si un site web ne s\'affiche pas correctement sur un smartphone ou une tablette, les utilisateurs seront rapidement frustr&eacute;s et quitteront le site. Cela peut avoir des cons&eacute;quences n&eacute;fastes pour l\'entreprise ou l\'organisation qui poss&egrave;de le site web.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: justify;\">De plus, la conception de sites web responsives est importante pour le r&eacute;f&eacute;rencement naturel. Google a d&eacute;clar&eacute; que les sites web responsives seront favoris&eacute;s dans les r&eacute;sultats de recherche mobiles. En d\'autres termes, si votre site web n\'est pas con&ccedil;u de mani&egrave;re responsive, il risque de perdre en visibilit&eacute; sur les moteurs de recherche.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: left;\"><strong><span style=\"color: #e67e23; font-size: 18pt;\">Comment concevoir un site web responsive ?</span></strong></p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: justify;\">Il existe plusieurs approches pour concevoir un site web responsive. Voici quelques-unes des principales :</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<ul>\n<li style=\"text-align: justify;\">Conception flexible : la conception flexible consiste &agrave; cr&eacute;er un site web en utilisant des unit&eacute;s de mesure relatives, telles que les pourcentages, plut&ocirc;t que des unit&eacute;s de mesure absolues, comme les pixels. Cela permet au site web de s\'adapter automatiquement &agrave; diff&eacute;rentes tailles d\'&eacute;cran.</li>\n</ul>\n<p>&nbsp;</p>\n<ul>\n<li style=\"text-align: justify;\">Grilles de mise en page : les grilles de mise en page sont un outil de conception qui permet de diviser la page en colonnes et en rang&eacute;es. En utilisant une grille de mise en page, il est possible de cr&eacute;er un site web qui s\'adapte facilement &agrave; diff&eacute;rents appareils.</li>\n</ul>\n<p>&nbsp;</p>\n<ul>\n<li style=\"text-align: justify;\">Images adaptatives : les images adaptatives sont des images qui s\'adaptent &agrave; la taille de l\'&eacute;cran sur lequel elles sont affich&eacute;es. Cela permet d\'&eacute;viter les images floues ou &eacute;tir&eacute;es sur les &eacute;crans plus petits.</li>\n</ul>\n<p>&nbsp;</p>\n<ul>\n<li style=\"text-align: justify;\">Media queries : les media queries sont un outil de conception qui permet de modifier la mise en page d\'un site web en fonction de la taille de l\'&eacute;cran. En utilisant des media queries, il est possible de cr&eacute;er un site web qui s\'adapte automatiquement &agrave; diff&eacute;rentes tailles d\'&eacute;cran.</li>\n</ul>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"text-align: justify;\">En r&eacute;sum&eacute;, la conception de sites web responsives est essentielle pour s\'assurer que les sites web s\'affichent correctement sur tous les appareils. Il existe plusieurs approches pour concevoir un site web responsive, notamment la conception flexible, les grilles de mise en page, les images adaptatives et les media queries. En adoptant une approche de conception responsive, les entreprises et les organisations peuvent am&eacute;liorer l\'exp&eacute;rience utilisateur et augmenter leur visibilit&eacute; en ligne.</p>', 1, '2023-05-10 00:00:00', 1, '2023-05-11 12:23:13', '2023-05-12 16:10:56', 'Conception de sites web responsives : guide.', ' Conception de sites web responsives : améliorez l\'expérience utilisateur et la visibilité en ligne.\n'),
(2, 'Ma mère au Brésil', 'ma-mere-au-bresil', 'P1LZrG2RKWzq5POoKD8aKcDU3hcvgr-metac2l0ZS1yZXNwb25zaXZlLnBuZw==-.png', '<p>&nbsp;</p>\n<p>Ma m&egrave;re a toujours &eacute;t&eacute; une aventuri&egrave;re dans l\'&acirc;me. Apr&egrave;s avoir &eacute;lev&eacute; ses enfants et travaill&eacute; dur pendant des ann&eacute;es, elle a d&eacute;cid&eacute; de prendre une retraite bien m&eacute;rit&eacute;e et de partir explorer le monde. Son premier choix a &eacute;t&eacute; le Br&eacute;sil, un pays qu\'elle avait toujours r&ecirc;v&eacute; de visiter.</p>\n<p>&nbsp;</p>\n<p>Elle a pass&eacute; des mois &agrave; pr&eacute;parer son voyage, apprenant le portugais et lisant tout ce qu\'elle pouvait sur la culture et les coutumes br&eacute;siliennes. Quand elle est finalement arriv&eacute;e &agrave; S&atilde;o Paulo, elle &eacute;tait pr&ecirc;te &agrave; tout d&eacute;couvrir.</p>\n<p>&nbsp;</p>\n<p>Elle a &eacute;t&eacute; &eacute;merveill&eacute;e par la beaut&eacute; de la ville, ses parcs luxuriants et ses b&acirc;timents historiques. Elle a rencontr&eacute; des gens merveilleux, qui lui ont fait d&eacute;couvrir la cuisine locale et l\'ont invit&eacute; &agrave; danser la samba. Elle a m&ecirc;me eu la chance de visiter les c&eacute;l&egrave;bres chutes d\'Igua&ccedil;u, un moment qu\'elle ne pourra jamais oublier.</p>\n<p>&nbsp;</p>\n<p>Ma m&egrave;re est rest&eacute;e au Br&eacute;sil pendant plusieurs mois, profitant de chaque instant et explorant chaque coin du pays. Elle a v&eacute;cu des exp&eacute;riences incroyables, mais ce qui l\'a le plus marqu&eacute;e, c\'est la chaleur des gens qu\'elle a rencontr&eacute;s. Ils lui ont ouvert leur c&oelig;ur et leur maison, et elle est rentr&eacute;e chez elle avec de nouveaux amis pour la vie.</p>\n<p>&nbsp;</p>\n<p>Maintenant, chaque fois que je vois ma m&egrave;re, je peux voir l\'&eacute;tincelle dans ses yeux quand elle parle de son voyage au Br&eacute;sil. C\'&eacute;tait une exp&eacute;rience qui a chang&eacute; sa vie, et je suis heureux de voir &agrave; quel point elle a &eacute;t&eacute; capable de vivre sa vie pleinement.</p>', 1, '2023-05-10 00:00:00', 1, '2023-05-11 15:48:02', '2023-05-12 16:11:23', NULL, NULL);
